export default function Onion({ veggie1, veggie2, veggie3 }: { veggie1: any, veggie2: any, veggie3: any, }) {
    let CATEGORY = "beauty"
    if (!veggie1 && !veggie2 && !veggie3) {
        return null
    }

    return (
        <svg width="1210" height="696" viewBox="0 0 1210 696" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
            {veggie1 && veggie1.category == CATEGORY ?
                <a href={veggie1.link} target="_blank" className="floater">
                    <rect x="596" y="195" width="207" height="136" fill="url(#onion1)" />
                </a>
                : null
            }
            {veggie2 && veggie2.category == CATEGORY ?
                <a href={veggie2.link} target="_blank" className="floater">
                    <rect x="558" y="67" width="207" height="136" fill="url(#onion2)" />
                </a>
                : null}
            {veggie3 && veggie3.category == CATEGORY ?
                <a href={veggie3.link} target="_blank" className="floater">
                    <rect x="369" y="135" width="207" height="136" fill="url(#onion3)" />
                </a>
                : null}
            <defs>
                <pattern id="onion1" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlinkHref="#onion_img" transform="matrix(0.00335342 0 0 0.00376615 -0.353425 -0.406154)" />
                </pattern>
                <pattern id="onion2" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlinkHref="#onion_img" transform="matrix(0.00335342 0 0 0.00376615 -0.353425 -0.406154)" />
                </pattern>
                <pattern id="onion3" patternContentUnits="objectBoundingBox" width="1" height="1">
                    <use xlinkHref="#onion_img" transform="matrix(0.00335342 0 0 0.00376615 -0.353425 -0.406154)" />
                </pattern>
                <image id="onion_img" width="500" height="500" xlinkHref="data:image/png;base64," />

            </defs>
        </svg>

    )
}